#include <iostream>
#include <fstream>

using namespace std;

ifstream in("exponent.in");
ofstream out("exponent.out");

int n, k;
int exp;

int main() {
  in >> n >> k;
  exp = 0;
  for (int i = 1; i <= n; i++) {
    int aux = i;
    while (aux % k == 0) {
      aux /= k;
      exp++;
    }
  }
  out << exp << endl;
  return 0;
}
